import React, { useRef, useEffect, useState } from 'react';
import GoogleMapReact from 'google-map-react';

const Map = ({data}) => {
  
  const coordinates = {lat:0,lng:0};
  return (

    <div className="mapContainer">
      <GoogleMapReact
        bootstrapURLKeys={{ key: 'AIzaSyDkJDTVx0PEYQMhrcSCtu8lO21clQxN6so' }}
        defaultCenter={coordinates}
        center={coordinates}
        defaultZoom={14}
        margin={[50, 50, 50, 50]}
        options={''}
        onChange={''}
        onChildClick={''}
      >

  </GoogleMapReact>
      </div>
  );
};

export default Map;
